import React from 'react';
import PropTypes from 'prop-types';

//app
import { LossActionTableView } from './LossAction.view';
import { useSort } from 'hooks';

LossActionTable.prototypes = {
  claims: PropTypes.object.isRequired,
  cols: PropTypes.array.isRequired,
  columnProps: PropTypes.object.isRequired,
  sort: PropTypes.object.isRequired,
  handleSort: PropTypes.func.isRequired,
  handleChangePage: PropTypes.func.isRequired,
  handleChangeRowsPerPage: PropTypes.func.isRequired,
  handleCreateClaimFromLoss: PropTypes.func.isRequired,
};

export default function LossActionTable({
  lossActions = { items: [] },
  cols: colsArr,
  columnProps,
  sort: sortObj,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  handleCreateClaim,
}) {
  const { cols, sort } = useSort(colsArr, sortObj, handleSort);

  const handleViewClaimClick = () => {};

  const handleEditClaim = () => {};

  return (
    <LossActionTableView
      rows={lossActions?.items || []}
      sort={sort}
      pagination={{
        page: lossActions.page,
        rowsTotal: lossActions.itemsTotal,
        rowsPerPage: lossActions.pageSize,
      }}
      cols={cols}
      columnProps={columnProps}
      handleSort={handleSort}
      handleChangePage={handleChangePage}
      handleChangeRowsPerPage={handleChangeRowsPerPage}
      handleViewClaimClick={handleViewClaimClick}
      handleCreateClaim={handleCreateClaim}
      handleEditClaim={handleEditClaim}
    />
  );
}
